"precision highp float;

 uniform sampler2D inputImageTexture;   //luminance

 varying vec2 textureCoordinate;
 varying vec2 leftTextureCoordinate;
 varying vec2 rightTextureCoordinate;

 varying vec2 topTextureCoordinate;
 varying vec2 topLeftTextureCoordinate;
 varying vec2 topRightTextureCoordinate;

 varying vec2 bottomTextureCoordinate;
 varying vec2 bottomLeftTextureCoordinate;
 varying vec2 bottomRightTextureCoordinate;

 void main()
 {
     // Kernel defination:
     // [tl][tc][tr]
     // [ml][mc][mr]
     // [bl][bc][br]

     //Horizontal Gradient
     //[-1  0  1]
     //[-2  0  2]
     //[-1  0  1]

     //Vertical Gradient
     //[-1 -2 -1]
     //[ 0  0  0]
     //[ 1  2  1]

     float tl = texture2D(inputImageTexture, topLeftTextureCoordinate).x;
     float tc = texture2D(inputImageTexture, topTextureCoordinate).x;
     float tr = texture2D(inputImageTexture, topRightTextureCoordinate).x;
     float ml = texture2D(inputImageTexture, leftTextureCoordinate).x;
     float mr = texture2D(inputImageTexture, rightTextureCoordinate).x;
     float bl = texture2D(inputImageTexture, bottomLeftTextureCoordinate).x;
     float bc = texture2D(inputImageTexture, bottomTextureCoordinate).x;
     float br = texture2D(inputImageTexture, bottomRightTextureCoordinate).x;

     float x_grad = tr - tl + 2.0 * (mr - ml) + br - bl;
     float y_grad = bl - tl + 2.0 * (bc - tc) + br - tr;

     float grad = 1.0 - clamp(sqrt(x_grad * x_grad + y_grad * y_grad), 0.0, 1.0);

     gl_FragColor = vec4(grad, grad, grad, 1.0);
 }
