"precision highp float;

 uniform sampler2D inputImageTexture;    // luminance
 uniform sampler2D inputImageTexture2;   // gaussianed luminance

 varying vec2 textureCoordinate;

 void main()
 {
     float luminance = clamp(texture2D(inputImageTexture, textureCoordinate).x, 0.001, 0.999);
     float luminance_gaussianed = clamp(texture2D(inputImageTexture2, textureCoordinate).x, 0.001, 0.999);

     float pseudoLines = 1.0;

     // luminance is bound to 0.999, it will never execeed 1.0, maybe we only need to restrict the lower bound to avoid devide by zero
     if (luminance >= 1.0) {
         pseudoLines = luminance;
     } else {
         pseudoLines = min(luminance / luminance_gaussianed, 1.0);
     }

     pseudoLines = 1.0 - clamp(pseudoLines - 0.05, 0.0, 1.0);

     gl_FragColor = vec4(pseudoLines, pseudoLines, pseudoLines, 1.0);
 }
 "

"precision highp float;

 uniform sampler2D inputImageTexture;    // pushThinLined luminance in channels a
 uniform sampler2D inputImageTexture2;   // gaussianed linemap
 uniform sampler2D inputImageTexture3;   // color

 uniform float texelWidth;
 uniform float texelHeight;
 uniform float lineDetectThreshold; // 0.0 - 1.0

 varying vec2 textureCoordinate;
 varying vec2 leftTextureCoordinate;
 varying vec2 rightTextureCoordinate;

 varying vec2 topTextureCoordinate;
 varying vec2 topLeftTextureCoordinate;
 varying vec2 topRightTextureCoordinate;

 varying vec2 bottomTextureCoordinate;
 varying vec2 bottomLeftTextureCoordinate;
 varying vec2 bottomRightTextureCoordinate;

 #define FXAA_REDUCE_MIN (1.0 / 128.0)
 #define FXAA_REDUCE_MUL (1.0 / 8.0)
 #define FXAA_SPAN_MAX 4.0

 void main()
 {
     float lineDetectMulti = 6.0;

     vec2 texelResolution = vec2(texelWidth, texelHeight);

     float lineProbability = texture2D(inputImageTexture2, textureCoordinate).x;

     vec3 center = texture2D(inputImageTexture3, textureCoordinate).xyz;

     if (lineProbability < lineDetectThreshold) {
         gl_FragColor = vec4(center, 1.0);
         return;
     }

     float fxaaStrength = 2.0;
     float strength = clamp(lineProbability * fxaaStrength * lineDetectMulti, 0.0, 1.0);

     vec3 luma = vec3(0.299, 0.587, 0.114);

     float lumaNW = texture2D(inputImageTexture, topLeftTextureCoordinate).a;
     float lumaNE = texture2D(inputImageTexture, topRightTextureCoordinate).a;
     float lumaSW = texture2D(inputImageTexture, bottomLeftTextureCoordinate).a;
     float lumaSE = texture2D(inputImageTexture, bottomRightTextureCoordinate).a;
     float lumaM = texture2D(inputImageTexture, textureCoordinate).a;

     float lumaMin = min(lumaM, min(min(lumaNW, lumaNE), min(lumaSW, lumaSE)));
     float lumaMax = max(lumaM, max(max(lumaNW, lumaNE), max(lumaSW, lumaSE)));

     vec2 dir;
     dir.x = -((lumaNW + lumaNE) - (lumaSW + lumaSE));
     dir.y =  ((lumaNW + lumaSW) - (lumaNE + lumaSE));
     float dirReduce = max((lumaNW + lumaNE + lumaSW + lumaSE) * (0.25 * FXAA_REDUCE_MUL),FXAA_REDUCE_MIN);
     float rcpDirMin = 1.0 / (min(abs(dir.x), abs(dir.y)) + dirReduce);
     dir = min(vec2(FXAA_SPAN_MAX, FXAA_SPAN_MAX), max(vec2(-FXAA_SPAN_MAX, -FXAA_SPAN_MAX), dir * rcpDirMin)) * texelResolution;

     vec3 rgbA = 0.5 * (texture2D(inputImageTexture3,   textureCoordinate + dir * (1.0 / 6.0)).xyz +
                        texture2D(inputImageTexture3,   textureCoordinate + dir * (-1.0 / 6.0)).xyz);
     vec3 rgbB = rgbA * 0.5 + 0.25 * (texture2D(inputImageTexture3,  textureCoordinate + dir * (-0.5)).xyz +
                                      texture2D(inputImageTexture3,  textureCoordinate + dir * 0.5).xyz);
     vec3 final = texture2D(inputImageTexture3, textureCoordinate).xyz;

     float lumaB = dot(rgbB, luma);

     if((lumaB < lumaMin) || (lumaB > lumaMax)) {
         final = (1.0 - strength) * final + strength * rgbA;
     } else {
         final = (1.0 - strength) * final + strength * rgbB;
     }

     gl_FragColor = vec4(final, 1.0);
 }
 "

"precision highp float;

 uniform sampler2D inputImageTexture;

 varying vec2 textureCoordinate;

 varying vec2 texelPositionPositive1;
 varying vec2 texelPositionPositive2;
 varying vec2 texelPositionPositive3;

 varying vec2 texelPositionNegative1;
 varying vec2 texelPositionNegative2;
 varying vec2 texelPositionNegative3;

 void main()
 {
     // Kernel defination:
     // [tl][tc][tr]
     // [ml][mc][mr]
     // [bl][bc][br]

     //Horizontal Gradient
     //[-1  0  1]
     //[-2  0  2]
     //[-1  0  1]

     //Vertical Gradient
     //[-1 -2 -1]
     //[ 0  0  0]
     //[ 1  2  1]

     float texelPositive1 = texture2D(inputImageTexture, texelPositionPositive1).x;
     float texelPositive2 = texture2D(inputImageTexture, texelPositionPositive2).x;
     float texelNegative1 = texture2D(inputImageTexture, texelPositionNegative1).x;
     float texelNegative2 = texture2D(inputImageTexture, texelPositionNegative2).x;
     float texelCenter = texture2D(inputImageTexture, textureCoordinate).x;

     float gaussianed = ((texelPositive2 + texelNegative2) * 1000.0 + (texelPositive1 + texelNegative1) * 1098.0 + texelCenter * 1132.0) / 5328.0;

     gl_FragColor = vec4(gaussianed, gaussianed, gaussianed, 1.0);
 }
