"precision highp float;

 uniform sampler2D inputImageTexture;    // gradient
 uniform sampler2D inputImageTexture2;   // gaussianed linemap
 uniform sampler2D inputImageTexture3;   // color

 uniform float pushLineStrength;

 varying vec2 textureCoordinate;
 varying vec2 leftTextureCoordinate;
 varying vec2 rightTextureCoordinate;

 varying vec2 topTextureCoordinate;
 varying vec2 topLeftTextureCoordinate;
 varying vec2 topRightTextureCoordinate;

 varying vec2 bottomTextureCoordinate;
 varying vec2 bottomLeftTextureCoordinate;
 varying vec2 bottomRightTextureCoordinate;

 vec4 getAverage(vec4 center, vec4 a, vec4 b, vec4 c, float strength) {
     vec4 blendLuminance = (1.0 - strength) * center + strength * (a + b + c) / 3.0;

     return blendLuminance;
 }

 float max3Gradient(vec4 a, vec4 b, vec4 c) {
     return max(max(a.a, b.a), c.a);
 }

 float min3Gradient(vec4 a, vec4 b, vec4 c) {
     return min(min(a.a, b.a), c.a);
 }

 void main()
 {
     float lineDetectMulti = 6.0;
     float lineDetectThreshold = 15.0 / 255.0;

     float lineProbability = texture2D(inputImageTexture2, textureCoordinate).x;

     vec3 center = texture2D(inputImageTexture3, textureCoordinate).xyz;

     if (lineProbability < lineDetectThreshold) {
         gl_FragColor = vec4(center, 1.0);
         return;
     }

     float strength = clamp(lineProbability * pushLineStrength * lineDetectMulti, 0.0, 1.0);

     // Kernel defination:
     // [tl][tc][tr]
     // [ml][mc][mr]
     // [bl][bc][br]

     vec4 tl = vec4(texture2D(inputImageTexture3, topLeftTextureCoordinate).xyz, texture2D(inputImageTexture, topLeftTextureCoordinate).x);
     vec4 tc = vec4(texture2D(inputImageTexture3, topTextureCoordinate).xyz, texture2D(inputImageTexture, topTextureCoordinate).x);
     vec4 tr = vec4(texture2D(inputImageTexture3, topRightTextureCoordinate).xyz, texture2D(inputImageTexture, topRightTextureCoordinate).x);

     vec4 ml = vec4(texture2D(inputImageTexture3, leftTextureCoordinate).xyz, texture2D(inputImageTexture, leftTextureCoordinate).x);
     vec4 mc = vec4(texture2D(inputImageTexture3, textureCoordinate).xyz, texture2D(inputImageTexture, textureCoordinate).x);
     vec4 mr = vec4(texture2D(inputImageTexture3, rightTextureCoordinate).xyz, texture2D(inputImageTexture, rightTextureCoordinate).x);

     vec4 bl = vec4(texture2D(inputImageTexture3, bottomLeftTextureCoordinate).xyz, texture2D(inputImageTexture, bottomLeftTextureCoordinate).x);
     vec4 bc = vec4(texture2D(inputImageTexture3, bottomTextureCoordinate).xyz, texture2D(inputImageTexture, bottomTextureCoordinate).x);
     vec4 br = vec4(texture2D(inputImageTexture3, bottomRightTextureCoordinate).xyz, texture2D(inputImageTexture, bottomRightTextureCoordinate).x);

     vec4 blendColor = mc;

     float maxDark = max3Gradient(br, bc, bl);
     float minLight = min3Gradient(tr, tc, tl);

     if (minLight > mc.a && minLight > maxDark) {
         gl_FragColor = vec4(getAverage(mc, tl, tc, tr, strength).xyz, 1.0);
         return;
     } else {
         maxDark = max3Gradient(tl, tc, tr);
         minLight = min3Gradient(br, bc, bl);

         if (minLight > mc.a && minLight > maxDark)
         {
             gl_FragColor = vec4(getAverage(mc, br, bc, bl, strength).xyz, 1.0);
             return;
         }
     }

     maxDark = max3Gradient(mc, ml, bc);
     minLight = min3Gradient(mr, tc, tr);

     if (minLight > maxDark)
     {
         gl_FragColor = vec4(getAverage(mc, mr, tc, tr, strength).xyz, 1.0);
         return;
     }
     else
     {
         maxDark = max3Gradient(mc, mr, tc);
         minLight = min3Gradient(bl, ml, bc);

         if (minLight > maxDark)
         {
             gl_FragColor = vec4(getAverage(mc, bl, ml, bc, strength).xyz, 1.0);
             return;
         }
     }

     maxDark = max3Gradient(ml, tl, bl);
     minLight = min3Gradient(mr, br, tr);

     if (minLight > mc.a && minLight > maxDark)
     {
         gl_FragColor = vec4(getAverage(mc, mr, br, tr, strength).xyz, 1.0);
         return;
     }
     else
     {
         maxDark = max3Gradient(mr, br, tr);
         minLight = min3Gradient(ml, tl, bl);

         if (minLight > mc.a && minLight > maxDark)
         {
             gl_FragColor = vec4(getAverage(mc, ml, tl, bl, strength).xyz, 1.0);
             return;
         }
     }

     maxDark = max3Gradient(mc, ml, tc);
     minLight = min3Gradient(mr, br, bc);

     if (minLight > maxDark)
     {
         gl_FragColor = vec4(getAverage(mc, mr, br, bc, strength).xyz, 1.0);
         return;
     }
     else
     {
         maxDark = max3Gradient(mc, mr, bc);
         minLight = min3Gradient(tc, ml, tl);

         if (minLight > maxDark)
         {
             gl_FragColor = vec4(getAverage(mc, tc, ml, tl, strength).xyz, 1.0);
             return;
         }
     }

     gl_FragColor = vec4(mc.xyz, 1.0);
 }
