 void main()
 {
     vec3 offset = vec3(-16.0 / 256.0, -0.5, -0.5);
     vec3 ycbcr = texture2D(inputImageTexture, textureCoordinate).xyz;
     ycbcr = ycbcr + offset;
     vec3 rCoeff = vec3(1.164, 0, 1.596);
     vec3 gCoeff = vec3(1.164, -0.3918, -0.8130);
     vec3 bCoeff = vec3(1.164, 2.017, 0);

     float r = dot(ycbcr, rCoeff);
     float g = dot(ycbcr, gCoeff);
     float b = dot(ycbcr, bCoeff);

     gl_FragColor = vec4(r, g, b, 1.0);
 }
