  lowp float checkForPresenceWithinSphere = step(distanceFromCenter, radius);

  distanceFromCenter = distanceFromCenter / radius;

  highp float normalizedDepth = radius * sqrt(1.0 - distanceFromCenter * distanceFromCenter);
